import React from "react"

class InputTodo extends React.Component {
	constructor(props){
		super(props);
		this.state = {
			title: ""
		}
	}

	render(){
		return(
			<div>
				<form>
					<input type='text' placeholder="Learn React..." value={this.state.title} />
					<input type='submit' value="Add" />
				</form>
			</div>
			)
	}
}
export default InputTodo
